const QRDecoderMain = (props) => {
  const iframeStyle = {
    width: '100%',
    height: '100%',
  }

  return <div {...props}>
    <iframe sandbox='' src='https://mudev.cc/qrdecode' style={iframeStyle} />
  </div>;
}

export { QRDecoderMain };
